import ReactDom from 'react-dom'
import './App.css'
import Header from './Header';
import MainContent from './MainContent';


function App() {
  return (
    <>
      <Header />
      <MainContent />
    </>
  )
}

ReactDom.render(
  <App />,
  document.getElementById('root')
);
